Passage: Hong Kong (CNN) -- Long gone are the days of ice sculptures and crepe suzette served up as a matter of course in first class cabins on airliners. But what is presented to premium passengers can still rival some top hotels or restaurants, and can often act as a good barometer for the health of an airline's fortunes. "When times get tough, food is one of the costs airlines can cut without jeopardizing safety," says Andreas Weber, general manager of airline catering company, Gate Gourmet. "It has changed back and forth (over time); airlines go through crises," he says. "(Today) more airlines are investing substantially in their first and business class products. Making people comfortable in big seats, everyone is doing that already, but what is left is the catering experience."
