Passage: (CNN) -- The Olympic torch has wound its way through more than 100 cities in the relay leading up to next month's Winter Games in Sochi, Russia. But the turn it took Monday highlighted a fear held by many people across the globe. A runner carried the torch through Makhachkala, capital of Dagestan -- a region embattled by Islamic insurgents. The event went off without a hitch, with security in place and some cheering supporters lining the streets. But the international focus on that moment served as a reminder of the militants who have carried out deadly attacks recently in Russia, and who have threatened more.
