Passage: (CNN) -- Filing nervously into a sports hall in Mosul, northern Iraq, around 20 girls prepared to practice gymnastics. Compared to their male counterparts at Mosul University's Faculty of Sport, their number is small. Another difference is that the gates to the sports hall were locked behind them and an announcement made that the hall was exclusively allocated for women. Liqaa Abdul Muttalib, a rhythmic gymnastics trainer says the facilities are not ideal: "There are pillars in the hall which limit free movement and rotational flips. This hall was initially designed for physical fitness." Behind another locked gate Ammar Shihab was coaching the university's recently formed five-a-side female football team.
