Passage: Mogadishu, Somalia (CNN) -- Somalia's Parliament ousted the country's Prime Minister in a vote of no confidence Monday after a dispute between him and the President over Cabinet picks. The move against Prime Minister Abdi Farah Shirdon is the latest government shake-up for a country that has struggled to achieve an effective central government since a dictator's overthrow two decades ago. Shirdon, in office less than 14 months, lost the confidence vote 184-65, Parliament Speaker Mohamed Osman Jawari said. He said the current government will remain until a new prime minister takes office. Somalia's constitution gives President Hassan Sheikh Mohamud a month to appoint a new prime minister, who would need to be confirmed by Parliament.
