Passage: Seoul, South Korea (CNN) -- South Korea will conduct naval fire drills near a flashpoint with the North that resulted in the deaths of four people, military officials said Thursday. The South Korean Joint Chiefs of Staff announced the exercises will take place in the seas southwest of Yeonpyeong Island on a day to be announced between December 18 and 21. The South previously announced military exercises for this week, but Thursday's announcement adds to them. Tensions mounted between the Koreas on November 23, when North Korea shelled the island, which lies in South Korean territory. The attacked killed two marines and two civilians and injured 18 people.
