Passage: (CNN) -- This might be the start of a new chapter in the browser wars. Over the weekend, Google Chrome routed more Internet traffic than Microsoft's Internet Explorer, which long has held its spot as the most-used Web browser in the world, according to data from StatCounter, an Internet monitor. Don't rush to over-interpret this bit of news, though. Other Internet trackers still show Internet Explorer -- which comes pre-installed on many Windows computers and has long been a default -- in the lead. And some groups have criticized StatCounter's data collection methods, saying the group does not account for the different ways countries collect Internet traffic data.
