Passage: (CNN) -- With more than 6,000 years of history, China's ancient capital of Nanjing has been the birthplace of many of the country's most intriguing traditional arts. Today, a handful of skilled artisans are keeping these endangered practices alive. Sophisticated and elegant yet not exclusive to the wealthy, these six Nanjing art forms offer insight into China's diverse yet dwindling collection of intangible attractions that, for the most part, remain hidden behind studio doors. CNN sent Sun Chen, a Nanjing-based photographer, to visit six studios in the city and talk with the artisans. Engraved Buddhist scrolls Sitting in a traditional Chinese building with a scenic garden, Nanjing's Jinling Buddhism Publishing House was founded in 1866 by a Buddhist scholar.
