Passage: (CNN) -- It's not easy being a Chechen. The family of Tamerlan and Dzhokar Tsarnaev, the alleged Boston bombers, have, like all their ethnic kin, led lives marked by violence and deportation. Chechnya is a small land in the Caucasus mountains that was one of the last places to be conquered by the Russian empire in the 19th century. Chechens are also Muslims. In February 1944, Joseph Stalin added them to his list of "punished peoples," whole ethnic groups who were deemed disloyal to the Soviet Union and subjected to wholesale deportation. Every Chechen -- man, woman and child -- was packed into freight cars and shipped to the freezing steppe of Soviet Central Asia. The republic of Chechnya was erased from the map. Around a quarter of the 400,000 deported Chechens died in the process. It was only 13 years later, after Stalin's death, that they were miraculously forgiven and allowed to return home. But some, including members of the Tsarnaev family, stayed on in places like the republic of Kyrgyzstan.
