Passage: Joint Base Lewis-McChord, Washington (CNN) -- Army Staff Sgt. Calvin Gibbs has been sentenced to life in military prison with eligibility for parole in 10 years. A military court-martial Thursday found Gibbs guilty of murdering three Afghan civilians, illegally cutting off pieces of their corpses to keep as "souvenirs" and planting weapons to make the men appear as if they were Taliban fighters killed in legitimate firefights. He was reduced in rank to private and ordered to forfeit all pay and benefits. Whatever sentence Gibbs serves will be reduced by the 547 days he has already spent in prison. "He said they were all dirty savages," prosecutor Maj. Andre Leblanc said at Gibbs' sentencing hearing.
