Passage: (CNN) -- Ready to jive, cool cats? Let's slide! "Jackson 5ive" ran as part of ABC's Saturday morning cartoon lineup beginning in September 1971. A heavily fictionalized representation of the Jackson 5's rise to fame and subsequent success, it was co-produced by Rankin/Bass (of Christmas special fame) and Motown Records. A relic replete with bell bottoms, tie dyed shirts and reel-to-reel tape players, the series has been released on DVD/Blu-ray by DreamWorks Classics. Every episode featured two musical numbers by the cartoon counterparts of Jackie, Tito, Jermaine, Marlon and Michael Jackson. The songs -- Jackson 5 staples like "ABC," "The Love You Save," and "I'll Be There" -- were woven in to the plotlines of the show, which experienced a renaissance in 1984 with Michael Jackson's rising solo career. Although the show didn't feature the speaking voices of the Jacksons because of scheduling conflicts, it was them singing.
@highlight
